import React from 'react';
import Pic1 from './src/Assets/Car1.JPG';
import Pic2 from './Assets/Car2.JPG';
import Pic3 from './Assets/Car3.JPG';
import Pic4 from './Assets/Car4.JPG';
import Pic5 from './Assets/Car5.JPG';
import Pic6 from './Assets/Car6.JPG';
import Pic7 from './Assets/Car7.JPG';
import Pic8 from './Assets/Car8.JPG';
import Pic9 from './Assets/Car9.JPG';
import './Dashboards.css';

const Dashboards = () => {
  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <h1><i className="bi bi-car-front"></i>&nbsp;CarHub</h1>
      </header>
      <section className="dashboard-back">
        <h2>HIRE OR BUY YOUR FAVORITE CAR FROM US</h2>
        <h3>AND THE REST WILL BE HISTORY</h3>
      </section>
      <section className="dashboard-mid">
        <h1>VINTAGE CARS AVAILABLE</h1>
        <h2>CHECK OUT OUR TOP RATED FLEET</h2>
      </section>
      <section className="dashboard-slider">
        <div className="slider-group">
          <span><img src={Pic1} alt="Car 1" /></span>
          <span><img src={Pic2} alt="Car 2" /></span>
          <span><img src={Pic3} alt="Car 3" /></span>
        </div>
        <div className="slider-group">
          <span><img src={Pic4} alt="Car 4" /></span>
          <span><img src={Pic5} alt="Car 5" /></span>
          <span><img src={Pic6} alt="Car 6" /></span>
        </div>
        <div className="slider-group">
          <span><img src={Pic7} alt="Car 7" /></span>
          <span><img src={Pic8} alt="Car 8" /></span>
          <span><img src={Pic9} alt="Car 9" /></span>
        </div>
      </section>
      <footer className="dashboard-footer">
        <p>Privacy Policy | Terms of Use | Contact support</p>
        <p>&copy; All Rights are reserved | Designed by ABDULKAREEM AHMED</p>
      </footer>
    </div>
  );
}

export default Dashboards;
